import React, { useState } from 'react';
import AdminAuth from './components/AdminAuth';

function App() {
  const [tab, setTab] = useState('customer');

  return (
    <div>
      <button onClick={() => { console.log('Customer clicked'); setTab('customer'); }}>
        Customer Portal
      </button>
      <button onClick={() => { console.log('Admin clicked'); setTab('admin'); }}>
        Admin Portal
      </button>
      <div style={{marginTop: '2rem'}}>
        {tab === 'customer' ? <div>Customer Portal Content</div> : <AdminAuth />}
      </div>
    </div>
  );
}

export default App;
